import React, {useState} from 'react';
import './style.css';
import { PieChart } from "react-minimal-pie-chart";


function AdminDashboardPage() {
  let weakCounter = 0;
  let fairCounter = 0;
  let goodCounter = 0;
  let strongCounterer = 0;

  async function retrievePasswords() {
		const response = await fetch("http://localhost:3001/retrievePasswords", {
			method: 'GET',
			headers: {
				'Accept': 'application/json',
				'Content-Type': 'application/json'
			}
		});
		const data = await response.json();
    data.forEach((password) => {
      switch(password.strength){
        case 'weak':
          weakCounter++;
          break;
        case 'weak':
          weakCounter++;
          break;
        case 'weak':
          weakCounter++;
          break;
        case 'weak':
          weakCounter++;
          break;

        default:
          console.log(password.strength)
      }
      console.log(password.strength)
    })
	}

  retrievePasswords()
  return (
    <div>
      <PieChart
    animation
    animationDuration={500}
    animationEasing="ease-out"
    center={[50, 50]}
    data={[
      {
      color: '#01a917',
      title: "strong",
      value: 10,
      },
      {
      color: "#0b75ed",
      title: "good",
      value: 15,
      },
      {
      color: "#ebbd04",
      title: "fair",
      value: 20,
      },
      {
      color: "#e20b07",
      title: "weak",
      value: 20,
      },
    ]}
    labelPosition={50}
    lengthAngle={360}
    lineWidth={30}
    paddingAngle={0}
    radius={50}
    rounded
    startAngle={0}
    viewBoxSize={[100, 100]}
       />
       </div>
  )
}

export default AdminDashboardPage;
